import { makeStyles } from "@material-ui/core/styles";

export const useStyles = makeStyles((theme) => ({
  root: {
    maxWidth: "60%",
    maxHeight: "100%",
    left: "20%",
    position: "relative",
    borderRadius: 50,
  },

  media: {
    height: 0,
    width: "100%",
    paddingTop: "50.25%",
  },
}));
